import { useSelector } from "react-redux";

function Detail() {
  const detail = useSelector((state) => state.videogameDetail);
console.log(detail);
  return ( <div>
    <h1>{detail.name}</h1>
    <img src={detail.image} alt={detail.name}/>
    <div>{detail.platforms.map}</div>
    </div> );
}

export default Detail;
